float roundTo8th(float x) {
    return (int)(x * 8) / 8.0;
}

int cMod(int a, int b) {    //Continuous modulo function; doesn't return negative values
    if (a < 0) {
        return ((a % b) + b) % b;
    }
    else {
        return a % b;
    }
}

string utf8(int codePoint) {
    char result[5] = "\0\0\0\0";

    if (codePoint <= 0x7f) {
        result[0] = (char)codePoint;
    }
    else if (codePoint <= 0x7ff) {
        result[0] = (char)(((codePoint >> 6) & 0x1f) | 0xc0);
        result[1] = (char)((codePoint & 0x3f) | 0x80);
    }
    else if (codePoint <= 0xffff) {
        result[0] = (char)(((codePoint >> 12) & 0x0f) | 0xe0);
        result[1] = (char)(((codePoint >>  6) & 0x3f) | 0x80);
        result[2] = (char)((codePoint & 0x3f) | 0x80);
    }
    else if (codePoint <= 0x10ffff) {
        result[0] = (char)(((codePoint >> 18) & 0x07) | 0xf0);
        result[1] = (char)(((codePoint >> 12) & 0x3f) | 0x80);
        result[2] = (char)(((codePoint >>  6) & 0x3f) | 0x80);
        result[3] = (char)((codePoint & 0x3f) | 0x80);
    }

    return string(result);
}

/******************************************************************************/
//getLevelIFStream() and getLevelFileP()
//Checks multiple locations for filename and sets string correctly so that
//the file can be written back to later.
/******************************************************************************/

ifstream getLevelIFStream(string& fileName) {
    ifstream levelFile;
    levelFile.open(fileName);
    if (!levelFile) {
        string attempt2 = string("levels/").append(fileName);
        levelFile.open(attempt2);
        if (!levelFile) {
            string attempt3 = string("levels\\").append(fileName);
            levelFile.open(attempt3);
            if (!levelFile) {
                cerr << "Could not open " << fileName << endl;
            }
            else {
                fileName = attempt3;
            }
        }
        else {
            fileName = attempt2;
        }
    }
    return levelFile;
}

FILE* getLevelFileP(string& fileName) {
    FILE* levelFile = NULL;
    levelFile = fopen(fileName.c_str(), "rb");
    if (!levelFile) {
        string attempt2 = string("levels/").append(fileName);
        levelFile = fopen(attempt2.c_str(), "rb");
        if (!levelFile) {
            string attempt3 = string("levels\\").append(fileName);
            levelFile = fopen(attempt3.c_str(), "rb");
            if (!levelFile) {
                cerr << "Could not open " << fileName << endl;
            }
            else {
                fileName = attempt3;
            }
        }
        else {
            fileName = attempt2;
        }
    }
    return levelFile;
}

